import { Button, Stack } from '@mui/material';
import React, { useState, useEffect } from 'react';
import { useForm, SubmitHandler } from 'react-hook-form';
import CreateUserCard from '../CreateUserCard';

interface DashboardProps {
  logout: any;
}

type Inputs = {
  email: string;
  firstName: string;
  lastName: string;
  gender: string;
  status: string;
};

const Dashboard: React.FunctionComponent<DashboardProps> = ({ logout }) => {
  const [create, setCard] = useState('');
  const [view, setView] = useState(false);

  useEffect(() => {}, [create]);

  // const {
  //   register,
  //   handleSubmit,
  //   watch,
  //   formState: { errors }
  // } = useForm<Inputs>();

  const onSubmit = (e: any) => {};

  return (
    <div>
      <Stack>
        <Button onClick={() => setCard('create')} variant="text">
          Create User
        </Button>
        <Button onClick={() => setCard('view')} variant="contained">
          View User
        </Button>
      </Stack>
      {create && <CreateUserCard />}
    </div>
  );
};

export default Dashboard;
